import React from 'react';
import ReactDOM from 'react-dom';


function Greeting() {
    return (
        <>
            <h2>Hi,</h2>
            <Hello />
            <Hell />
        </>
    )
}

const Hello = () => <h3>Let's Get Started</h3>;
const Hell = () => <h4> Let's Go</h4>;



ReactDOM.render(
    <>
        <h1>
            Hello
</h1>
        <Greeting />
    </>

    ,
    document.getElementById('root')
)
